import React, { Component } from 'react';

export default class TodoForm extends Component {

    render() {
        return (
            <React.Fragment>
                <NotesDiv>
                <ul>
                    <li>this</li>
                    <li>is</li>
                    <li>a</li>
                    <li>todo</li>

                </ul>
                </NotesDiv>
            </React.Fragment>
        )
    }
}
